import React from "react";
import { useNavigate } from "react-router-dom";

const Login = () => {
    const navigate = useNavigate();
    return (
        <>
            <h1>Login page</h1>
            <button onClick={() => { navigate('/') }}>Main</button>
        </>
    );
}

export default Login;
